<h1><a name="MSG_NO_EMPTY_LAYER"></a>C.2.59 Aucun calque n'a été trouvée sans contenu, le module ne peut donc pas être importé</h1>
<p>
La fonction du module d'importation a besoin d'un calque vide pour fonctionner, mais aucun n'a pu être trouvé. Effacez un calque et réessayez.</p>
